import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom'; // Обратите внимание на Routes
import './styles/style.css'
function App() {
    return(
       <Router>
            <div>
                <h5>Текстиль Мебель</h5>
                <link>Домой</link>
                <link>О нас</link>
                <link>Товары</link>
            </div>




       </Router>
    );
}

export default App;
